const matchData = [];

for (let i = 1; i <= 32; i++) {
  matchData.push({
    id: i,
    team1: {
      logo: `https://via.placeholder.com/50?text=Team${i * 2 - 1}`,
      name: `Team ${i * 2 - 1}`,
    },
    team2: {
      logo: `https://via.placeholder.com/50?text=Team${i * 2}`,
      name: `Team ${i * 2}`,
    },
    date: `${String(i).padStart(2, '0')}-12 18:00`, // Gün-Ay Saat formatında, günleri 2 haneli yapar
  });
}

export default matchData;
